def maxProfit(prices):
    if len(prices) <= 2:
        return 0
    buy = prices[0]
    max_profit = 0
    for price in prices[1:]:
        current_profit = price - buy
        max_profit = max(max_profit, current_profit)
        buy = min(buy, price)
    return max_profit

